import React from 'react';

export default function MyComponent() {
  const f1 = () => {
    alert("Hello World!");
  }

  const f2 = (x) => {
    alert(x);
  }

  return (
    <div>
      <button onClick={f1}>Submit</button>
      <button onClick={() => { alert('Hello') }}>Submit</button>
      <button onClick={() => { f2(10) }}>Submit</button>
      
    </div>
  );
}
